import './App.css';

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="container">
      <nav className="navbar navbar-expand navbar-dark navbar-bg">
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
              Home
          </li>

        </div>
      </nav>
    </div>
  );
}

export default App;
